import React, { Component } from 'react';

const Product = props => (
    <tr>
      <td>{props.product.name}</td>
      <td>{props.product.price}</td>
      <td>{props.product.description}</td>
      <td>{props.product.owner}</td>
    </tr>
)

export default Product;
